&lt;p&gt;&lt;strong&gt;Revo&reg; 4 STX-HS Low Profile Baitcast Reel&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;A continued tradition of precision engineering and powerful performance, the Revo&reg; STX is loaded with features that provide on the water advantages day in and out. A new Gull Wing&trade; sideplate design allows for quick and easy access to the almost limitless IVCB-6L&trade; (Infinitely Variable Centrifugal Brake) brake system. A more durable Duragear&trade; brass gear featuring the D2 Gear Design&trade; makes for one of the strongest yet most efficient gear systems.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Features:&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;
&lt;li&gt;10 stainless steel ball bearings + 1 roller bearing provides smooth operation&lt;/li&gt;
&lt;li&gt;X2-Cr&auml;ftic&trade; alloy frame for increased corrosion resistance&lt;/li&gt;
&lt;li&gt;Aluminum handle sideplate combined with C6 carbon palm sideplate provides improved strength and durability&lt;/li&gt;
&lt;li&gt;Power stack Carbon Matrix Drag System&trade; provides extreme drag pressures combined with unparalled smoothness&lt;/li&gt;
&lt;li&gt;Duragear&trade; brass gear for extended gear life&lt;/li&gt;
&lt;li&gt;D2 Gear Design&trade; provides a more efficient gear system while improving gear durability&lt;/li&gt;
&lt;li&gt;Everslik&trade; coated pinion shaft and pawl creates a diamond like coating which improves wear resistance while reducing friction&lt;/li&gt;
&lt;li&gt;DuraClutch&trade; design provides improved engagement and durability&lt;/li&gt;
&lt;li&gt;IVCB-6L&trade; (Infinitely Variable Centrifugal Brake) braking system delivers precise external adjustments for a wide variety of baits while 6 internal locking modules allow anglers to easily fine tune and maximize casting distance&lt;/li&gt;
&lt;li&gt;Gull Wing&trade; sideplate design allows for quick and easy access to braking systems and the spool&lt;/li&gt;
&lt;li&gt;Infini IITM spool design for extended castability and extreme loads&lt;/li&gt;
&lt;li&gt;Compact bent handle and star provide a more ergonomic design&lt;/li&gt;
&lt;li&gt;Ti coated line guide reduces friction and improves durability&lt;/li&gt;
&lt;li&gt;Lube port for easy access maintenance&lt;/li&gt;
&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;Specifications:&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;
&lt;li&gt;Reel Handle Position: Right&lt;/li&gt;
&lt;li&gt;Gear Ratio: 7.3:1&lt;/li&gt;
&lt;li&gt;Retrieve Rate: 30 | 76cm&lt;/li&gt;
&lt;li&gt;Braking System: Centrifugal&lt;/li&gt;
&lt;li&gt;Bearing Count: 11&lt;/li&gt;
&lt;li&gt;Weight: 7.30&lt;/li&gt;
&lt;li&gt;Braid Capacity Yd/Lb: 190/20 140/30 100/50&lt;/li&gt;
&lt;li&gt;Mono Capacity Yd/Lb: 175/10 145/12 100/15&lt;/li&gt;
&lt;li&gt;Drag Material: Carbon Fiber&lt;/li&gt;
&lt;li&gt;Max Drag: 24lb | 10.8kg&lt;/li&gt;
&lt;li&gt;Reel Spool Material: Aluminum&lt;/li&gt;
&lt;li&gt;Drag Type: Star Drag&lt;/li&gt;
&lt;li&gt;Reel Size: Low Profile&lt;/li&gt;
&lt;li&gt;Anti-Reverse Feature: Instant Anti-Reverse&lt;/li&gt;
&lt;/ul&gt; &lt;!--- cis:y4w2Om4GJ5A= ---&gt;Abu Garcia Revo&reg; 4 STX-HS Low Profile Baitcast Reel&lt;p&gt;&lt;u&gt;Condition&lt;/u&gt; : This item is brand new, unopened and sealed in its original factory box.&lt;/p&gt;

